import React from "react";
import {Route, Switch} from "react-router-dom"
export default function Contenct(){
    return(
        <Switch>
          <Route exact path="/">
            <h1>home</h1>
          </Route>
          <Route path="/github">
            <h1>github</h1>
          </Route>
        </Switch>
    )
}
